        <script>H5PIntegration = {"ajax":{"setFinished":"","contentUserData":""},"ajaxPath":"/h5p/ajax?action=","contents":{"cid-1036467259":{"displayOptions":{"copy":false,"copyright":true,"embed":false,"export":false,"frame":true,"icon":false},"fullScreen":"0","jsonContent":"{\"content\":[{\"content\":{\"params\":{\"text\":\"<h3><strong>Problem 1: The Neighborhood's Famous Man'oushe</strong></h3>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Problem 1\",\"authors\":[],\"changes\":[]},\"subContentId\":\"54403fd3-f66c-406f-a5f2-0845575e5288\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"taskDescription\":\"Documentation tool\",\"pagesList\":[{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p>My cousin John is visiting Lebanon for the first time ever, so he has to taste the most famous \\\"man'oushe mashrouha\\\" from a bakery in our neighborhood. People stand in line in front of that bakery to place their order.</p>\\n\\n<p>It is like the New Yorker pizza but with a Lebanese twist. It is very large making it barely fit through the bakery's front door. The best thing is that you can customize it with different Lebanese toppings: cheese, thyme, labneh, etc...The man'oushe is rounded and divided into twelve equal pieces. After a long wait, we got our order. I ate three slices, and he ate four.</p>\\n\\n<ul>\\n</ul>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"577859b4-901a-4e1a-8875-9aec93fca814\"},{\"params\":{\"decorative\":false,\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAC7gAAAOECAIAAAC+IOufAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAAJcEhZcwAADsMAAA7DAcdvqGQAAP+lSURBVHhe7L2HehNN1rX9n//h/O/M4JxNzgYMtkLnnHO3gr+1q2Rh5IAwBgze97VG02p1V1ftChKu9VT9f2cMwzAMwzAMwzAM8yCZnk2b8SiuSytPhknQi72TyOmn/iAPe6mPY+g08bQqcSbVsIgGsWcVSd tField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"f806bf03-2aa9-42d1-aae0-57573bf12e69\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Problem\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Problem\"},\"subContentId\":\"57952310-05a3-4d47-84f4-fe14019459e9\"},{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p>1) I ate three slices, which means I ate \\\\(\\\\frac{3}{12}\\\\) of the man'oushe.</p>\\n\\n<p>John ate four slices, which means he ate \\\\(\\\\frac{4}{12}\\\\) of the man'oushe.</p>\\n\\n<p>\\\\(\\\\frac{3}{12} + \\\\frac{4}{12} = \\\\frac{7}{12}\\\\)</p>\\n\\n<p>We ate seven twelfths of the man'oushe.</p>\\n\\n<p></p>\\n\\n<p>2) \\\\(1 - \\\\frac{7}{12} = \\\\) \\\\(\\\\frac{12}{12} - \\\\frac{7}{12}\\\\)\\\\(= \\\\frac{5}{12}\\\\)</p>\\n\\n<p>Five twelfths of the man'oushe is left.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"78cc9665-83f7-4156-881d-ae2e20bcdb1c\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Solution\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Solution\"},\"subContentId\":\"6ae8c46d-e4b9-4fcb-9b42-4a82c7dc825a\"}],\"i10n\":{\"previousLabel\":\"Previous documentation step\",\"nextLabel\":\"Next documentation step\",\"closeLabel\":\"Close\"}},\"library\":\"H5P.DocumentationTool 1.8\",\"metadata\":{\"contentType\":\"Documentation Tool\",\"license\":\"U\",\"title\":\"Documentation Tool\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Documentation Tool\"},\"subContentId\":\"8d8ce3c8-f30a-49db-8eb5-9fa7062a3848\"},\"useSeparator\":\"disabled\"},{\"content\":{\"params\":{\"text\":\"<h3
